import Link from 'next/link';

const Nav = () => (
  <div id="navwrapper">
    <Link href="/">
      <a>J & M Transmission</a>
    </Link>
    <div id="linkwrapper">
      <h2>Ham</h2>
      <ul>
        <li><Link href="/">
          <a>Contact Us</a>
        </Link></li>
        <li><Link href="/">
          <a>About</a>
        </Link></li>
      </ul>
    </div>

    <style jsx>{`
      #navwrapper {
        float: left;
        width: 100%;
        background: rgba(89, 89, 89, .8);
        margin: 0;
      }
      #linkwrapper {
        float: right;
      }
      a {
        float: left;
        padding: 22px;
        text-decoration: none;
        color: white;
        font: 18px 'Rubik';
        transition: all ease .4s;
      }
      a:hover {
        background: rgba(89,89,89,.4);
        color: #FF6161;
      }
      ul {
        float: left;
        display: block;
        margin: 0;
      }
      li {
        float: left;
        list-style: none;
        margin: 0;
      }
      h2 {
        float: left;
        display: none;
      }

/* This is the mobile version styling of the Navigation-Bar */

      @media only screen and (max-device-width: 480px) {
        #linkwrapper {

        }
        h2 {
          display: block;
          margin-right: 15px;
          color: white;
        }
        h2:hover ~ ul {
          display: block;
        }
        ul {
          display: none;
          position: absolute;
          top: 30px;
          width: 50px;
        }

      }
      `}</style>
  </div>
);

export default Nav;
